import { Splide, SplideSlide } from "@splidejs/react-splide";
import "@splidejs/react-splide/css";

const Carousel = ({
  type,
  things,
  options = {
    perMove: 1,
    type: "loop",
    arrows: true,
    autoplay: true,
    pagination: false,
    gap: "2em",
    perPage: 5,
    breakpoints: {
      768: {
        perPage: 4,
      },
      640: {
        perPage: 2,
      },
    },
    focus: "center",
  },
}) => {
  return (
    <Splide aria-label="Infantry Class Slider" options={options}>
      {Array.isArray(things) &&
        things.map((item, index) => {
          return (
            <SplideSlide key={index} data-splide-interval="2000">
              {}
            </SplideSlide>
          );
        })}
    </Splide>
  );
};

export default Carousel;
